Mongoose: CastError at path "_id" when ID is not being called<p>Stack in question: Node, EJS, Mongo, Mongoose</p>
<p>My routing was set up so:</p>
<pre><code>app.get('/products', async (req,res) =&gt; {
    const products= await Product.find({});
    res.render('products/index', {products});
})

app.get('/products/:id', async (req,res) =&gt;{
    const {id} = req.params;
    const product = await Product.findById(id);
    res.render('products/show', {product});
})

app.get('/products/new', (req,res)=&gt;{
    res.render('products/new');
})
</code></pre>
<p>And I was getting this error:</p>
<pre><code>CastError: Cast to ObjectId failed for value &quot;new&quot; at path &quot;_id&quot; for model &quot;Product&quot;
</code></pre>
<p>And I eventually fixed the error by moving the /new route above the /:id route.</p>
<p>My question is: why did that fix it? I wasn't calling {id} in the /new route. The /new route wasn't calling anything except for my EJS file in the res.render. I can't find any reason on the internet why moving the route higher in the code fixed the issue.</p>

